export default (function(a,b,c,d,e,f,g,h){return {data:{eK6B3sRL6T:{data:{id:1916,attributes:{imdbId:"tt0066162",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYWQ4MWYxOTMtZjIwNS00MjdkLWExYjYtZDExODA0YWM2YzZjXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.4\u002F10"}],item_lang:{data:{id:2579,attributes:{title:c,plot:"A Vietnam veteran returns to his Texas home but feels restless and decides to become a radio singer. Based on the novel by Charles Portis.",slug:"norwood"}}},books:{data:[{id:9633,attributes:{title:c,description:f,thumbnail:g,authors:[b],firstBook:true,published:h,publisher:d,subtitle:a}},{id:9634,attributes:{title:c,description:f,thumbnail:g,authors:[b],firstBook:e,published:h,publisher:d,subtitle:a}},{id:9635,attributes:{title:"The Dog of the South",description:"His wife, Norma, has run off with her ex-husband, taking Ray's cards, shotgun and car. But from the receipts, Ray can track where they've gone. He takes off after them, as does an irritatingly tenacious bail bondsman, both following the romantic couple's spending as far as Mexico. There Ray meets Dr Reo Symes, the seemingly down-on-his-luck and rather eccentric owner of a beaten up and broken down bus, who needs a ride to Belize. The further they drive, in a car held together by coat-hangers and excesses of oil, the wilder their journey gets. But they're not going to give up easily.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ozuEDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2007-06-05",publisher:d,subtitle:a}},{id:9636,attributes:{title:c,description:a,thumbnail:a,authors:[b],firstBook:e,published:"1966-01-01",publisher:a,subtitle:"- 2. Printing"}},{id:9637,attributes:{title:"Escape Velocity",description:"Collected here in Escape Velocity, edited by Jay Jennings, is his \"miscellany\" †“†“ journalism, short fiction, memoir, and even the play Delray's New Moon, published for the first time in this volume. Â Portis covers topics as varied as the civil rights movement, road tripping in Baja, and Elvis' s visits to his aging mother for publications such as the New York Herald Tribune and Saturday Evening Post. Â Fans of Portis’s droll Southern humor and quirky characters will be thrilled at this new addition to his library, and those not yet familiar with his work will find a great introduction to him here. Â Also included are tributes by accomplished authors including Donna Tartt and Ron Rosenbaum.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4xKEDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2013-08-27",publisher:d,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940953038}}("","Charles Portis","Norwood","Abrams",null,"Sent on a mission to New York he gets involved in a wild journey that takes him in and out of stolen cars, freight trains, and buses. By the time he returns home to Texas, Norwood has met his true love, Rita Lee, on a bus; befriended the second shortest midget in show business and “the world's smallest perfect fat man†?; and helped Joann “the chicken with a college education,†? realize her true potential in life. As with all Portis’ fiction, the tone is cool, sympathetic, and funny.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pTuEDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","1999-08-01"))